import React from 'react';
import './App.css';

export default class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          value: "Not Clicked",
          data: null
        };
    }

    componentDidUpdate() {
      fetch("/api")
        .then((res) => res.json())
        .then((data) => this.SetState({data: data.message}));
    }

    render() {
        return <div className="App">
            <div className="Test">
                <button onClick={this.onClick.bind(this)}>Mint</button>
                <div className="Test">
                    <span>{this.state.data}</span>
                </div>
            </div>
        </div>;
    };
    onClick(e) {
      this.SetState({data: data.message});
    }
};
